TABLEATTRIBUTE.VALUE:
UPDATE IN_ETL_CONTROL SET DEC_RUNNING_FLG = 1 WHERE TXT_KEY_STRING LIKE '$$STR_RUNNING_FLAG';
UPDATE IN_ETL_CONTROL SET TXT_KEY_VALUE=(SELECT LPAD(TO_CHAR(COUNT(*)*3),10,'0') FROM PER_LIMRA,IN_ETL_CONTROL where PER_LIMRA.CMCD IN ('SG','BN') AND IN_ETL_CONTROL.TXT_KEY_STRING = 'OPER_CYCLE_DATE' AND TO_CHAR(PER_LIMRA.CYCLE_MTH,'YYYYMM') = TO_CHAR(TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE ,'YYYY-MM-DD'),'YYYYMM') AND (PER_LIMRA.AGENT_TYPE = '01' AND DECODE(PER_LIMRA.CMCD,'SG','SGT','BN','BRT')||PER_LIMRA.AGT IN ( SELECT NAME FROM CS_POSITION WHERE EFFECTIVESTARTDATE<= TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE,'YYYY-MM-DD') AND EFFECTIVEENDDATE > TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE,'YYYY-MM-DD') AND REMOVEDATE = TO_DATE('22000101','YYYYMMDD') ) OR PER_LIMRA.AGENT_TYPE IN( '02','03') AND DECODE(PER_LIMRA.CMCD,'SG','SGY','BN','BRY')||PER_LIMRA.AGY IN ( SELECT NAME FROM CS_POSITION WHERE EFFECTIVESTARTDATE<= TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE,'YYYY-MM-DD') AND EFFECTIVEENDDATE > TO_DATE(IN_ETL_CONTROL.TXT_KEY_VALUE,'YYYY-MM-DD') AND REMOVEDATE = TO_DATE('22000101','YYYYMMDD') ) )), DTE_UPDATE_DATE=SYSDATE WHERE TXT_KEY_STRING='LIMRA_PRESTAGE_RECORD_COUNT' AND DEC_RUNNING_FLG=1;
COMMIT;
